import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
function LoginForm() {
    const formData = new FormData();
    const [Info,setInfo] = React.useState({
        username : "",
        password : "",
        fd : formData,
    });
    const requestOptionsSignUp ={
        method: 'POST',
        headers:{'Content-Type': 'multipart/form-data'},
        body: Info.fd
    };
    const requestOptionsLogin ={
        method: 'POST',
        headers:{'Content-Type': 'multipart/form-data'},
        body: Info.fd
    };
    const onChanged1 = (event: React.ChangeEvent<HTMLInputElement>) => {
        setInfo({
            ...Info,
            username : event.target.value,
        })
    };
    const onChanged2 = (event: React.ChangeEvent<HTMLInputElement>) => {
        setInfo({
            ...Info,
            password : event.target.value,
        })
    };
    return (
        <Box
            component="form"
            sx={{
                '& > :not(style)': { m: 1, width: '25ch' },
            }}
            noValidate
            autoComplete="off"
        >
            <TextField 
                id="outlined-basic"
                label="Username" 
                variant="outlined" 
                value={Info.username}
                onChange={onChanged1}
            />
            <TextField
                id="outlined-password-input"
                label="Password"
                variant="outlined" 
                value={Info.password}
                type="password"
                autoComplete="current-password"
                onChange={onChanged2}
            />
            <Button
                variant="contained"
                onClick={()=>{
                    console.log({
                        ID: Info.username,
                        password : Info.password
                    });
                    let newfd = new FormData();
                    newfd.append('username',Info.username);
                    newfd.append('password',Info.password);
                    setInfo({
                        ...Info,
                        fd : newfd
                    })
                }}
            >
                SignUp
            </Button>
            <Button
                variant="contained"
                onClick={()=>{
                    console.log({
                        ID: Info.username,
                        password : Info.password
                    });
                }}
            >
                Login
            </Button>
        </Box>
    );
}

export default LoginForm;
